import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class Team extends Component {
    render() {
        const { id, name } = this.props.team;
        return (
            <div>
                <p><this.props.team.title/></p>
            </div>
        )
    }
}

//PropTypes
Team.propTypes = {
    team: PropTypes.object.isRequired,
}
